import React, { useState } from 'react';
import axios from 'axios';
import { Button } from 'react-bootstrap';


function CalcRota() {
 const [route, setRoute] = useState([]);
 
 const handleCalcularRota = async () => {
    try {
        const response = await fetch('/calcularRota');
        const rota = await response.json();
        setRoute(rota)
        // Atualize o estado do componente com a rota calculada
        // e abra a modal para exibir os resultados
    } catch (error) {
        console.error('Erro ao calcular a rota', error);
    }
};

 return (
    <div className='container-filter'>     
    
      <Button variant="primary" onClick={handleCalcularRota}>Filtrar</Button>    
      {route}
    </div>
 );
}

export default CalcRota;
